import React from "react";
import { Navbar } from "./Navbar";
import Timeline from "@mui/lab/Timeline";
import TimelineItem from "@mui/lab/TimelineItem";
import TimelineSeparator from "@mui/lab/TimelineSeparator";
import TimelineConnector from "@mui/lab/TimelineConnector";
import TimelineContent from "@mui/lab/TimelineContent";
import TimelineDot from "@mui/lab/TimelineDot";
import HistorieCard from "./HistorieCard";
import usine60 from "../images/usine 1960.jpg";
import equipe60 from "../images/equipesacem60.jpg";
import transfo60 from "../images/transfo60.jpg";
import prop70 from "../images/propsacem70.jpg";
import chaud70 from "../images/chaudronnier70.png";
import bobinage80 from "../images/atelier bobinage80.jpg";
import essai80 from "../images/salle essai80.jpg";

const Historique = () => {
  const usine = { title: "usine 1966", image: { usine60 } };
  return (
    <div>
      <Navbar />
      <Timeline position="alternate">
        <TimelineItem>
          <TimelineSeparator>
            <TimelineDot variant="outlined" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <HistorieCard />
          </TimelineContent>
        </TimelineItem>

        <TimelineItem>
          <TimelineSeparator>
            <TimelineDot variant="outlined" color="primary" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <HistorieCard />
          </TimelineContent>
        </TimelineItem>
        <TimelineItem>
          <TimelineSeparator>
            <TimelineDot variant="outlined" color="secondary" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <HistorieCard />
          </TimelineContent>
        </TimelineItem>
        <TimelineItem>
          <TimelineSeparator>
            <TimelineDot variant="outlined" />
          </TimelineSeparator>
          <TimelineContent>
            <HistorieCard el={usine} />
          </TimelineContent>
        </TimelineItem>
      </Timeline>
    </div>
  );
};

export default Historique;
